import Statistics from './Statistics'

function StatisticList({ stats, title }) {
  return (
    <section>
      <h2 class="title">{title}</h2>

      <ul>
        {stats.map((stat) => (
          <li key={stat.id}>
            <Statistics label={stat.label} percentage={stat.percentage} />
          </li>
        ))}
      </ul>
    </section>
  )
}

export default StatisticList
